import rocketIcon from "../../assets/images/rocker_icon.svg";

const Hero = () => {
  return (
    <div className="hero_wrapper container">
      <div className="hero_texts">
        <h1 className="primary-header">Discover Digital Art & Collect NFTs</h1>
        <p>
          NFT marketplace UI created with Anima for Figma. Collect, buy and sell
          art from more than 20k NFT artists.
        </p>
        <Button
          padding={"1.9rem 3rem"}
          altText={"user icon"}
          imgSrc={rocketIcon}
          btnName={"Sign Up"}
        />
      </div>
      <div className="hero_img"></div>
    </div>
  );
};

export default Hero;
